import React from 'react';
import { Link } from 'react-router-dom';

class Home extends React.Component {
  render() {
    return (
      <div className="Home">
        <Link to="/login">Login</Link> | <Link to="/register">Register</Link>

        <br /><br /><p>Public home page content</p>
      </div>
    )
  }
}

export default Home;
